Django Ninja 提供了一個強大的過濾機制，允許您使用 FilterSchema 來處理查詢集的過濾。FilterSchema 是一個常規的 Schema，利用 Pydantic 的所有必要功能，並添加一些額外的特性來簡化將用戶面對的過濾參數轉換為數據庫查詢。 使用 FilterSchema 如果您希望用戶能夠根據多個不同的屬性過濾查詢集，將過濾器封裝到 FilterSchema 類中是有意義的。這樣可以方便地管理和應用過濾條件。 from ninja import FilterSchema, Field
from typing import Optional class BookFilterSchema(FilterSchema): name: Optional[str] = None author: Optional[str] = None created_after: Optional[datetime] = None @api.get("/books")
def list_books(request, filters: BookFilterSchema = Query(...)): books = Book.objects.all() books = filters.filter(books) return books 自定義過濾邏輯 您還可以獲取準備好的 Q 表達式並自行執行過濾。這允許您根據需要自定義過濾邏輯。 class BookFilterSchema(FilterSchema): search: Optional[str] = Field(None, q=['name__icontains', 'author__name__icontains', 'publisher__name__icontains'])
